import React from 'react'

function Ferry() {
  return (
    <div>ferry
      <div>
        <img src="./images/ferry1.jpg" alt=" ferry at luanda" title="slowest and safest"/>
        <img src="./images/ferry2.jpg" alt="ferry" title="bigest vessel available"/>
        <img src="./images/ferry.jpg" alt="Mbita ferry" title="cool and clean"/>
       </div>
       <p>Ferry is used to move from luanda kotieno to mbita <br/>It coasts 150ksh per passanger and at least 900ksh for a car.<br/>it takes a duration of 45 munites to doc at mbita</p>           
    </div>
  )
}

export default Ferry ;
